The development will comprise:
(i) Demolition of existing single storey sheds (670 sqm);
(ii) Construction of 5 no. five-storey, over basement, residential apartment buildings, accommodating a total of 90 no. residential apartments, each with and associated balcony / terrace. Block 1- accommodating 8 no. 2 bedroom apartments and 10 no. three-bedroom apartments, over ground to fourth floor levels, and Energy Centre (81 sqm), car parking, bicycle parking and bin stores at basement level. Part of Block 1 lies within the Dun Laoghaire Rathdown County Council administrative area, on land which is subject to a concurrent planning application to Dun Laoghaire Rathdown County Council, which specifically seeks permission for part of 10 no. three-bedroom apartments over ground to fourth floor levels, together with part of basement level car parking and the energy building. Block 2,3,4 and 5 each block to accommodate 16 no. 2 bedroom apartments and 2 no. 3 bedroom apartments over ground to fourth floor levels and car parking, bicycle parking and bin stores at basement level;
(iii) 90 no. residential car parking spaces at basement level, to include 5 no. universal access car parking spaces and 90 no. secure bicycle spaces;
(iv) Secure storage total 371 sq.m and 5 no. bin stores, total 94 sq.m at basement level;
(v) 37 no. visitor car spaces and 40 no. visitor bicycle spaces provided at surface / ground level;
(vi) ESB substation and switch room (27 sqm) and security / concierge office (13 sqm) at ground floor.
(vii) Communal amenity space, internal access roads, landscaping, boundary treatment, SuDS drainage and all ancillary works necessary to facilitate the development. Access to the development. Access to the development will be via an existing entrance and roadway from Greenfield Park. Widening of the entrance and roadway has been approved under Dun Laoghaire Rathdown County Council Reg. Ref. D15A/0860/ An Bord Pleanala Ref. PL06D.246607.

PROTECTED STRUCTURE: Planning permission for development at Nos. 36-38 Westland Row, Dublin 2 (a Protected Structure). The subject site is bound to the north by nos. 39 and 40 Westland Row and Cumberland Court, to the south by no. 35 Westland Row, Harcourt Row and nos. 22-24 Cumberland Street South (also known as South Cumberland Street), to the west by Westland Row and to the east by Cumberland Street South. The development will consist of the upgrading and extension of the existing Royal Irish Academy of Music's facilities from c. 4,039 sqm to c. 6,070 sqm. The development will comprise:
1. Demolition of existing modern extensions (with a combined area of c. 2,363 sqm) to the rear of Nos. 36-38 Westland Row and removal of existing yard area, boundary wall and fencing at the boundaries of Cumberland Court and Cumberland Street South;
2. Provision of a new 5 storey over lower ground floor extension to the rear of the Protected Structure, stepping down to 4.5 storeys equivalent to Cumberland Street South comprising c. 4,394 sqm with an overall height of c. 18.22m from Westland Row (c. 24.45mOD) and consisting of an opera studio, lecture theatre, research rooms, practice rooms, teaching rooms, music technology hub, costume and props room, library, records room, staff room, recital hall, green room, box office and cloak room, sound and lighting room, backstage area and associated offices, waiting rooms / foyers, toilets, changing rooms, ESB, plant rooms and all associated circulation space;
3. Provision of sedum roof located at levels 4 and 5;
4. Revised drainage arrangements within the site including the provision of a storm water attenuation tank at basement level under proposed plant room to the rear of the site;
5. Creation of 2 no. courtyard areas and associated landscaping; 
6. Removal of existing external fire escape stairs to all levels and replacement by enclosed glazed link to the rear of the Protected Structure;
7. Provision of new glazed link at upper ground floor level connecting rear of Protected Structure with proposed extension;
8. Provision of wheelchair access arrangements to nos. 36-38 Westland Row via the main entrance and comprising the partial removal of an existing iron railing and curb wall, modifications to existing external steps and installation of a platform lift;
9. Provision of a free standing powder coated aluminium totem sign on a galvanised steel frame c. 2.5m above ground floor level (c. 8.73mOD) at the Westland Row facade; and
10. All associated site development works.

PROTECTED STRUCTURE: Permission and for retention permission for development on a 225 sqm site approximately.
The development will consist of the:
Change of use at first floor level from office to shop; removal, alteration and replacement of internal stud partition walls at ground and first floor levels;
replacement of defective plaster and moldings on the front facade;
removal of existing downlights on parapet wall;
removal of cabling and lighting on shopfront fascia and their replacement with a LED strip;
removal of a later addition staircase at the rear of the building and its replacement with a new freestanding, detachable lift core; 
provision of a lightweight glazed extension between the new lift shaft and the rear of the building (29 sq m);
installation of replacement sliding sash timber frame windows at the rear of the building; and all associated site development and ancillary works above and below ground.
The development also consists of the retention of changes to the building facade (shopfront) comprising: 
the replacement of signage with backlit signage; 
and the replacement of a plate glass door with a single glass pane.

Under the Planning Scheme for the North Lotts and Grand Canal Dock Strategic Development Zone.
Development will consist of the demolition of an existing single storey building and the construction of a new eight-storey mixed-use development, comprising:
i) Café/ retail use, with new shop front, at ground floor level;
ii) 7 no. two-bedroom apartments on above-ground floor levels (1 no. apartment on each floor) with private terraces/ balconies to each apartment; communal landscaped roof garden; apartment entrance lobby, bicycle store and bin store at ground floor level;
iii) plant/ lift core at roof level;
iv) drainage and all associated site works necessary to facilitate the development.

Site (0.52ha) at Gardiner Street Lower, Summerhill and Gloucester Place Lower & Upper, Dublin 1, (Site bound by Gardiner Street Lower and Diamond Park to the west, Summerhill to the north, Gloucester Place Upper & Lower to the east and Diamond Park and Lourdes Parish School to the south). 
The development will consist of an extension (Phase 2: 4,005sq.m gross floor area) to the permitted (under construction) Student Residence Complex (Reg. Ref. 3611/14 and 3345/16) comprising a 6/7-storey building accommodating 117 no. bed spaces in 81 no. units. 
The proposed accommodation is as follows: 
- Lower Ground Floor Level (635.2sq.m): - Reception area with access from Gloucester Place Upper/ Lower. 11 no. 1 bed studios and 2 no. communal rooms (Study Zone - 101 sq.m and Games/ Relaxation Space - 108.5 sq.m). This level has access to external amenity areas and bicycle parking (34 no. spaces); 
- Ground Floor Level (646.9 sq.m): - 10 no. 1 bed studio units and 2 no. 5 bed units, a link to the permitted student Residence Complex (Phase 1) is provided at this level and involves minor revisions to the layout of the permitted Phase 1 building resulting in the loss of  2 no. bed spaces from unit G.05 (from 6 to 4 bed unit); 
- First Floor Level (641.5 sq.m): 11 no. 1 bed studios and 2 no. 5 bed units: 
- Second Floor Level (641.5 sq.m): 11 no.1 bed studios and 2 no. 5 bed units; 
- Third Floor Level (641.5 sq.m);  11 no. 1 bed studios and 2 no. 5 bed units; 
- Fourth Floor Level (528.4 sq.m): 11 no. 1 bed studio units and 1 no. 5 bed units. This level includes an external roof terrace (95 sq.m);
- Fifth Floor Level (270 sq.m): 7 no. 1 bed studio  units. 
The proposed accommodation also includes ancillary corridors, a lift core and 2 no. stair cores. 
Permission is also sought for hard and soft landscaping, boundary treatments, signage (east & west elevations) and all ancillary site and development works. 
The proposed extension brings the overall Student Residence Complex to 18,968 sq.m gross floor area comprising 606 bed spaces in 169 no. units.

PROTECTED STRUCTURE: Amendments to the development permitted under Reg. Ref. 2836/15 (An Bord Pleanála Ref.: PL29S.245313) for a mixed use development at a site of circa 0.576 ha. The site includes protected structures at No. 4 (RPS Ref.: 7544) and No. 5 (RPS Ref.: 7545) Sir John Rogerson's Quay and the facade of No. 2 (RPS Ref.: 7543) Sir John Rogerson's Quay.
The proposed amendments relate to minor amendments to the permitted office development on the corner of Windmill Lane and Creighton Street and are as follows: 
-Amendment to the permitted fourth and fifth floor (over ground) layout resulting in an additional 89.7 sq.m of overall gross floor space;
-Minor amendment to western facade as a result of amendments to fourth and fifth floors;
-Provision of a 4.3 metre high sliding, folding oak clad gate to screen the approved ESB sub-station on the west elevation;
-All ancillary and associated works.

PROTECTED STRUCTURE: Planning permission for various works. The works comprise: (i) Demolition of non-original lean-too, ground floor extension to the rear return (area 20.5 sq.m),
(ii) Construction of a new single-storey, double-pitched roof extension to rear of the original return (area 30 sq.m), with gable elevation to rear and four rooflights;
(iii) Alterations to internal layout of existing return to accommodate kitchen and utility room;
(iv) Alterations to the previously altered window openings to the side elevation of the return;
(v) Formation of a new opening in the central wall between the living and dining rooms with folding panelled doors;
(vi) Removal of non-original stud wall and first floor of return and construction of a new relocated wall to create an enlarged bedroom with adjoining bathroom;
(vii) Removal of existing non-original en-suite and built-in wardrobe within Bedroom 1 and replacement with new en-suite and wardrobe area along party wall;
(viii) Relocation of existing fireplace surround from Bedroom 1 to ground floor living room and removal of existing non-original living room fireplace surround, (to be retained in storage).

Conversion of the property from 6 no. self-contained apartment units to provide for 2 no. four-bedroom family dwellings. Works will comprise:
(i) Demolition of the existing building including rear extensions, except the front facade (elevation facing Serpentine Avenue) which will be retained;
(ii) Construction of 2 no. four-bedroom family dwellings comprising the re-construction of the two-storey building and roof in its original form and height, and to include a two-storey rear extension with dormer level accommodation;
(iii) Additional entrance door on front elevation;
(iv) Alteration to the vehicular entrance on Serpentine Avenue to provide a separate vehicular entrance and 1 no. on-curtilage car parking space for each dwelling; in addition to a new plinth wall and railing to the remainder of the front boundary of both dwellings;
(v) Private garden to the rear of each dwelling; landscaping; roof light on flat roof section of rear extension of both dwellings; boundary treatments and all other ancillary works necessary to facilitate the development.

Planning permission is sought for proposed works consisting of the following principal elements:
1. Change of use from office to residential use;
2. Demolition of existing two-storey return to rear of existing building
3. Construction of a new extension to the rear of two and three stories;
4. Internal alterations and refurbishment works;
5. The development will include all associated drainage and site development works.

Development to amend a previously permitted 137 no. bedroom hotel (DCC Reg.Ref. 2246/15; ABP Reference PL29S.245162) on a site of c. 0.1441 ha. The development will consist of: 
- an additional two bedrooms at Ground Floor Level (increasing the total number of bedrooms from a permitted 137 no. to 139 no.); 
- a single storey Ground Floor Level extension (measuring 63 sq.m) to the rear of the building;
- amendments to the permitted Basement Level resulting in an increase of floorspace by 66.5 sq.m (from 1,035 sq.m permitted to 1,101.5 sq.m proposed); 
- an external fire escape route on the roof of the Fourth Floor Level resulting in an extension of the eastern stair core (Stair Core 2) from Fourth Floor Level to Fifth Floor Level;
- an increase in the building's parapet height at Fifth Floor Level by 0.54 m from 18.87 m permitted to 19.41 m proposed; 
- solar PV cells on the roof of the Fifth Floor Level;
- four retractable fabric awnings at Ground Floor Level along the western elevation;
- and an overhanging canopy to the Fifth Floor to facilitate compliance with Condition No. 2 of the permitted development subject of this proposed amendment application.
The development will also consist of:
- amendments to the permitted internal layout;
- associated elevational alterations;
- the reconfiguration of the permitted plant on the roof of the Fourth Floor Level including the provision of louvred screening and a water tank.
- and associated alterations to the permitted scheme's services (mechanical and electrical, water supply, sewage disposal and surface water disposal).
The proposed development will result in the provision of a 139 no. bedroom hotel with a total gross floor area of 5,817 sq.m including a Basement Level of 1,101.5 sq.m (from a previously permitted total gross floor area of 5,671 sq.m including a Basement Level of 1,035 sq.m).

The development will consist of 
a) Demolition of existing single storey extension to the rear;
b) Construction of new two storey extension to the rear consisting of 24.25m2 at ground level and 14.97m2 at landing/first floor level; 
c) Provision of 2 no. new roof lights to the rear field of existing roof; 
d) Provision of 2 no. new roof lights to the proposed new flat roof at ground level; 
e) Internal alterations and all associated works.

PROTECTED STRUCTURE: Permission for development at No. 20 Ormond Road South, Rathmines, Dublin D06 A2CS - a Protected Structure. The development will consist of the following works to the two / three storey dwelling:
1. Demolition of single storey extension to rear;
2. Construction of a new single storey extension with 2no. linear roof lights to the rear;
3. Construction of 3 no. new conservation roof lights at attic level in the main roof to rear;
4. Rear and side elevation changes to include construction of 2 no. new windows to the side passageway;
5. Refurbishment and internal amendments to the existing dwelling on all levels to include new staircase to proposed converted attic space;
6. All associated conservation and repair work, landscaping to front and rear gardens, drainage an site development works.

The development will consist of works to include: 
- Change of use of unit from former bookmakers to create a new dentist surgery (68sqm);
- Alterations to shop front to include new fascia signage (2.52 sqm), new sign above door (0.3 sqm); and film manifestation to existing fenestration and;
- Alterations to internal fit out.

The Davy Platform ICAV acting on behalf of its sub fund Elm Real Estate Investments, intends to apply for full planning permission for amendments to previously approved planning application Reg.Ref. 2894/15 and Reg.Ref. 3892/16. The application site is bound by Merrion Road to the east.
The development will consist of:
- Amendments to the location of the basement plant;
- Relocation to the bicycle parking area at basement level;
- 4 no. additional car parking spaces at basement level;
- Alterations to the triple height glazed box floor plates and link bridges on the 2nd, 3rd and 4th floor to provide additional office accommodation of 749 sq.m in Office Building 1.
- Entrance canopy positions and extent amended at the main entrances.
- Relocation of pedestrian crossing position.
The proposed amendments will result in an increase in the overall gross floor area of the development of 749 sq.m from 20,184 sq.m to 20,933 sq.m.

Development at this site of 0.280 ha. The proposed development will consist of amendments to a previously permitted 6 storey development (Reg.Ref. 3312/13; as modified by Reg. Ref. 4198/15 and Reg.Ref. 3372/16) including the following elements:
1) The construction of a new double-storey, low-voltage ESB substation (14 sq.m) at lower ground floor and ground floor levels, to be housed in a separate, self-contained structure, with access at ground floor level from Setanta Place;
2) Modifications to a previously permitted double-storey, medium-voltage ESB substation (14 sq.m), comprising a revised layout at lower ground floor and ground floor levels, and housed in a separate, self-contained structure with access at ground floor level from Setanta Place;
3) Proposed materials for the external facade of both substations will be traditional stock brick with access provided via a louvered acoustic screen.
4) All other associated and ancillary development and site works above and below ground.

The demolition of existing buildings, a public house, dry cleaners, builders yard/ office, 8 no. flats and the construction of:
(a) Block 1: a 4-storey structure, built onto Harold's Cross Road consisting 2 no. commercial units at ground floor level 3 no. 3 bedroom and 3 no. 2 bedroom residential units over all with balconies facing Harold's Cross Road;
(b) Block 2: a 4-storey structure to rear consisting of 4 no. 2 bedroom, 4 no. 1 bedroom units with balconies to front facing south west, 4 no. studio residential units with balconies to rear facing north east;
(c) Widened vehicular access off Harold's Cross Road to underground car park providing 18 car spaces and bicycle parking spaces, bin storage and
(d) Storage units, communal gardens and associated site works.

The development will consist of 
(i) Demolition of front porch, rear extensions and side shed;
(ii) Construction of single storey, flat roof, extension to the side and rear of the dwelling, with 1 no. roof light;
(iii) Refurbishment of front and rear facades of the dwelling including replacement doors and windows;
(iv) Replacement landing window, with increased height, on side elevation at first floor level;
(v) Widening of vehicular entrance to 3.6m; and
(vi) All ancillary works necessary to facilitate the development.

The development will consist of the removal of the existing boundary wall and palisade fence on the western and northern boundaries of the existing substation compound; the construction of; 
a) A new 2 storey [c. 14.7m high] 220 kV Gas Insulated Switchgear (GIS) building [840 sq.m] to the north of the existing GIS building accommodating electrical plant at ground floor and a control room and ancillary storage areas at first floor level; 
b) 2 No. bunded 220 kV transformer bays on the eastern elevation of the new GIS building; 
c) All associated and ancillary works, ducts and cabling associated with the removal, relocation, replacement and installation of electrical plant and switchgear on the site, the provision of overhead connecting bus ducts running between the existing and proposed GIS buildings; and the relocation of underground cables across the site; 
d) Modifications to openings on the northern and southern elevations of the existing GIS building; 
e) The removal of an existing tower mast on the southern side of the existing 220 kV substation proximate to the northern bank of the Grand Canal; 
f) The construction of a new boundary wall [up to 4m high] and palisade fence [up to 2.6m high] along the western and northern boundaries of the site; 
g) The erection of 11 no. lightning protection rods [up to 3m high] on existing and proposed structures; 
All ancillary works within the site including: the provision of additional areas of hard-standing and internal access ways and associated site drainage works and other site works including the provision of oil storage.

The proposed development seeks amendments to previously permitted residential development, Reg. Ref. 4244/15. The proposed amendments comprise of; (i) the infill of Blocks A and C at 2nd to 6th floor level to form new residential Block AC;
(ii) amendments to previously permitted apartment Blocks A and C to increase the height from 5 no. storeys to 6 no. storeys with a 7 no. storey element on the north-east corner of proposed Block AC;
(iii) amendments to all elevations of proposed Block AC;
(iv) reconfiguration of internal layout of proposed Block AC to provide for a total of 108 no. residential units with private balconies and terraces on all elevations (35 no. 1 bed units, 59 no. 2 bed units and 14 no. 3 bed units) which increases the total number of units in the previously permitted Blocks A and C by 23 no. units
(v) the provision of residential facilities at ground floor level to include gym; residents lounge, concierge/receptions area, entrance lobby, 3 no. meeting rooms and all ancillary facilities; 
(vi) provision of a double height walkway to access the rear central courtyard;
(vii) relocation of plant and bin stores; (viii) reconfiguration of basement car park to provide for a total of 316 no. car parking spaces and 545 no. cycle parking spaces together with all necessary site development works to facilitate the proposed development. The proposed amendments will increase the overall unit number from 283 no. to 306 no. in total.

Permission for development at a  site of 0.17 ha at the Marker Hotel, Grand Canal Square, Misery Hill, Dublin 2. The site is bound by Misery Hill to the South, Hibernian Road to the east , Chimney Park to the North and Forbes St to the West and located within City Block 12, as identified in the North Lotts & Grand Canal Dock SDZ Planning Scheme. The development consists of the following.
1. Additional level of bedroom accommodation at 7th floor level;
2. Extension of existing 6th floor level to building line on northern elevationz;
3. Increase in the existing rooftop facilities (now at 8th floor level) to include a resturant, function room and bar with external terrace on the southen elevation;
4. A new stair core on the northern elevation;
5. Relocated lift access to rooftop level.
The proposed amendments result in an overall increase in floor area of 2612.99sqm.

PROTECTED STRUCTURE: The development will consist of the demolition of the existing non-original single-storey extension to the side, the removal of the non-original balcony to the rear facade and the construction of the following: - a new 55 sq.m single-storey rear extension; 
-the remodelling of the ground floor by the insertion of new door and window opes to the side facade and the partial removal of two internal walls; 
-the replacement of a non-original bay window/ door to the first floor rear facade, restoring the original window condition; 
-the replacement of a number of non-original bathrooms at first floor level and the insertion of a new window ope to the upper side facade; 
-and general conservation and associated ancillary site works to include repointing of the existing brickwork facade and refurbishment of the existing sash windows.

The development will consist of: 
- Demolition of existing sub-standard extensions and shed structure to the rear; 
- Proposed new part single storey, part two storey extension to the rear;
- Rooflight on rear roof ;
- and all associated site and landscaping works.

Permission Is sought by Ted Keelan & Frances Colreavy for miscellaneous works at the property no. 46 Cowper Road, Rathmines, D06K5P5. Works include;
(a) Partial demolition of western boundary wall onto side laneway (Milltown Path) and reinstatement with new taller brick wall to match existing
(b) Widening and motorising existing front vehicular gateway to match exactly existing;
(c) Front driveway and rear garden landscaping including gazebo structure;
(d) All associated works.

The development will consist of:
1) Change of use from bakery to restaurant/ takeaway;
2) New shop front & signage;
3) Alterations to ground floor plan;
4) Alterations to the roof of the single storey elements at the rear of the building;
5) First floor extension to provide staff facilities ancillary to restaurant;
6) Time of operation of the restaurant 8.00 am to 11.00 pm;
7) Conversion of attic, new dormer window, and velux rooflight to rear at 2nd floor level to provide additional bedroom and ensuite bathroom to existing two bedroom apartment.

The development comprises amendments to the already permitted Dublin Port Road Network Improvement Project (Planning Ref. 3084/16) at no. 2 Branch Road North Extension. The development will consist of:
a) Modifications to approved scheme Planning Ref. 3084/16 for Dublin Port Road Network Improvement Project at No. 2 Branch Road North Extension;
b) Realignment and narrowing of c. 280 m of Promenade Road to omit 2 no. Right Slip Lanes;
c) Reconfiguration of no. 2 Branch Road North Extension from one-way southbound to two-way with primary access from the south and emergency access only from the north;
d) Minor modifications to junction of no. 2 Branch Road North Extension with Tolka Quay Road;
e) Modifications to TOP Yard 1 boundary and access arrangements to complement proposed TOP Change of Use from office use to Product Storage Tank - Planning Ref. 3820/08/x1;
f) Reduction in proposed car parking provision on No. 2 Branch Road North Extension from 50 spaces to 15 spaces, reflecting proposed TOP Change of Use - Planning Ref. 3820/08/x1;
g) Associated amendments to services and culvert.
The application is for a 10 year planning permission.

The development will consist of:
- Alterations to existing front garden wall and creation of new vehicular entrance 3.3 m wide with off-street parking space and new gates;
- Construction of new side boundary garden walls in front garden; 
- All associated site, landscaping works and services.

PROTECTED STRUCTURE: Amendments to a prior Grant of Permission (Ref.3389/12). The development will consist of:
a) the removal of existing structures of 77 sq.m at ground and basement levels linking the main house and the rear hall, and their replacement with a 92 sq.m double-height glazed atrium with associated toilets and servery;
b) a new stair from basement to first floor within the rear hall, with related internal alterations to kitchen, stores and sanitary facilities etc.;
c) the widening of the existing fire escape door onto Dawson Lane;
d) the reconfiguration of the existing fire escape stairs to north side of rear hall;
e) the widening of existing doorway and alterations to one existing window at basement level of Dawson Street elevation to create a new fire escape door and associated internal alterations at basement level within the main house to allow for the creation of a new fire escape route.

1) Construction of a dormer window to the rear at attic level with associated conversion;
2) A single storey extension to the front and
3) Widening the existing vehicular access exiting onto Ardara Avenue, Dublin 13.

Permission is sought by Midgard Construction Ltd. on lands at former Faulkner Industries Factory, Chapelizod Hill Road, Chapelizod, Dublin 20; Beann', 38 Chapelizod Hill Road, Chapelizod, Dublin 20; and Clarevill', 38D Chapelizod Hill Road, Chapelizod, Dublin 20, for mixed-use residential development of 171 no. apartments and a childcare facility over a single level basement. The proposed development will consist of:
a) The demolition of the existing former Faulkners Industries Factory complex along with the two no. 2 storey semi-detached dwellings known as 'Beann', 38 Chapelizod Hill Road, and Clarevill, 38D Chapelizod Hill Road;

(b) The construction of 171 no. apartments (53 no. 1 bedroom units; 92 no. 2 bedroom units; and 26 no. 3 bedroom units) in two no. 5 storey apartment blocks over a single level basement comprising: Block A - 5 storey (part 3 storey) block comprising of 93 no. residential units (34 no. 1 bedroom units; 50 no. 2 bedroom units; 9 no. 3 bedroom units) with balconies/terraces on the north, east, south and west elevations, Block A will also comprise 1 no. concierge office ancillary to the apartments (74 sq.m .GFA) and 1 no. childcare facility (291 sq.m. GFA) with ancillary out door play area, all of which will be at ground floor level. Block B - 5 storey apartment block over lower ground floor level, comprising 78 no. residential units (19 no.1 bedroom units, 42 no. 2 bedroom units; 17 no. 3 bedroom units) with balconies/terraces on all elevations; 

(c) A total of 205 no car parking spaces (172 no. resident parking spaces & 17 no visitor parking spaces and 10 no. disabled parking spaces at basement level and 6 no. surface level visitor car parking spaces and 2 no.surface level drop-off spaces at the childcare facility); 

(d) 13 no. motor cycle parking spaces at basement level. 188 no. bicycle parking spaces (176 no.spaces at basement level and 12 no. spaces at surface level); 

(e) Ancillary plant room and bin storage areas at basement level;

(f) 1 no.ESB sub-station; (g) modifications to the existing vehicular entrance to the former Faulkners Industries Factories on Chapelizod Hill Road; and provision of a new fire tender access to Chapelizod Hill Road;

(h) landscaping (including public, communal and private ope space and play equipment): 

(i) boundary treatment including new low wall and railing boundary to Chapelizod Hill Road; and, 

(j) all associated engineering works (including plant and solar panels at roof level) and site development works necessary to facilitate the development .

PROTECTED STRUCTURE: Development at a 0.41 hectare site. The application site is located within the RTE Campus which includes 2 no. protected structures Montrose House (RPS No. 7847) and Mount Errol House (RPS Ref. 7846), with access off Nutley Lane. The proposed development comprises of the following:
- Relocation of Fair City Lott filming set to a site in the north eastern area of the RTE Campus adjoining the boundary with properties on Nutley Road. This area is currently in use as a car parking area and a waste compacting area. The Fair City set will comprise of a total of 11 no. sets varying height from 6.1 m to 8.46 m and will include internal roads and footpaths.
- Provision of new internal service road to the north west of the existing Administration Building;
- Relocation of waste compacting and recycling area to the north eastern elevation and southern elevation of the existing Workshop Building;
- New 2.5 m high blockwork screening wall along eastern boundary of the amenity space to the south east of the Workshop Building;
- Provision of new 2.5 m timber clad fence along the north eastern boundary of the Fair City set and 1.8 m paladin fence along the remaining boundaries to enclose the Fair City Lott filming set; and
- Provision of landscaped screen along the north eastern boundary of the Fair City Lott.
- The application will also include all associated infrastructure and ancillary works including drainage, hard and soft landscaping to facilitate the development.

Development at this 2.62 ha site. The proposed development seeks amendments to the residential development permitted under Reg.Ref.: 4244/15 to provide for an additional 56 no. units (21 no. 1 bed units, 26 no. 2 bed units and 9 no. 3 bed units) increasing the total number of units from 283 no. to 339 no. The proposed amendments comprise of:
I. Increase in height of Blocks E, D and L from 5 no. storeys over basement to 6 no. storeys over basement.
II. Increase in height of Block F from 4 no. storeys over basement to 6 no. storeys over basement;
III. Increase in height of Blocks H, J and K from 4 no. storeys over basement to 5 no. storeys over basement;
IV. New design and layout of Block H, J and K to provide 6 no. 1-bed units and 18 no. 2-bed units in each block;
V. Reconfiguration of internal layout of Block D to provide 24 no. 2-bed units and 12 no. 3-bed units;
VI. Reconfiguration of internal layout and increase in footprint of Block E to provide 12 no. 1-bed units, 18 no. 2-bed units and 12 no. 3-bed units;
VII. Reconfiguration of internal layout of Block F to provide 6 no. 1-bed units, 18 no. 2-bed units and 12 no. 3-bed units.
VIII. Block L with the additional storey will overall provide 1 no. 1-bed unit, 29 no. 2-bed units and 6 no. 3-bed units;
IX. Amendments to all elevations of Blocks D, E, F, H, J, K, and L incorporating new and revised balconies/ terraces generally on all floors;
X. Reconfiguration of basement car park within permitted footprint to provide for a total of 344 no. car parking spaces and 552 no. cycle parking spaces together with all necessary site development works to facilitate the proposed development;
XI. Minor amendments to permitted landscaping scheme;
XII. All ancillary and associated site development works.

The development will consist of two no new signs as follows; 
1. LED illuminated three sided cube sign with powder coated aluminium finish situated at ground floor level to the north elevation adjacent courtyard entrance facing Mill St. 
